import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="root">
      <div>Game P,W</div>
      <div>Game scores</div>
      <div>
        Produce
      </div>
      <div>
        Wares
      </div>
      <div>
        Auction
      </div>
      <div>
        History
      </div>
    </div>
  );
}

export default App;
